import React, { useEffect, useState } from "react";

const MovieApi = () => {
  useEffect(() => {
    fetch("http://www.omdbapi.com/?s=animal&apikey=273b18f0")
      .then((res) => res.json())
      .then((data) => console.log(data));
  },[]);
  return (
    <>
      <div className="movie"></div>
    </>
  );
};

export default MovieApi;
